import React from "react";
import { BooksContext } from "./books/BookDataProvider";
 
export const Home  = ({book}) => {
  const {getBooks} = useContext(BooksContext)

    useEffect(()=>{
      console.log("Books show up!")
        getBooks()
    }, [])

  return (
   
      <div>
        <h2>WELCOME TO MY LIBRARY</h2>
        <p>A place to keep track of your library.</p>
        <h2>WishList</h2>
        <div>
        {book.filter(book => book.owned = false).map(filteredOwned => (
        <li>{filteredOwned.owned}</li> ))}
        </div>
        
 
        
      </div>
    );
    
}
